webpackJsonp([3369446859864],{1729:function(p,n){p.exports={data:{markdownRemark:{html:'<p>이른 아침에 "불행과 추모"를 읽는 것은 지난 3 년 동안 기록 된 책으로 다큐멘터리이자 생각을 자극하는 것입니다. 이 수업은 중국의 특수 학급이며 역사의 산물입니다. 대부분은 그들 자신의 심리적 활동이며, 지금은 중국 역사 기록으로서 가치가 있습니다.</p>\n<p>이 책의 일부 제목은 매우 철학적입니다.</p>\n<p>과거는 장미의 꿈이 아닙니다.</p>\n<p>고통에 감사드립니다.</p>\n<p>영혼을 하늘과 땅 사이에 드러내십시오.</p>\n<p>삶의 기간이있다.</p>\n<p>역사가있는</p>\n<p>우리는 문명의 불을 밝힙니다.</p>\n<p>돌, Sisyphus, 돌의 사상가 및 생각에 좋은 "돌"</p>\n<p>역사는 우리를 이해할 것이다.</p>\n<p>사는 것은 태양과 같습니다.</p>\n<p>그들이 방문한이 세상</p>\n<p>인생은 체커가 아닙니다.</p>\n<p>대부분의 사람들은 역사 정신에 잠겨 있습니다. 모든 사람들은 역사가입니다. 모든 역사가들은 인간입니다. 역사에서 역사는 사람들 사이에 있습니다. 사람들이 역사에 있거나, 역사가 인류 역사에 있거나, 역사가 역사에 있거나, 사람들이 사람들의 역사에 있거나, 사람들의 사람들 속에 역사가 있는지, 사람들은 역사의 역사, 또는 사람들의 역사 또는 역사의 역사.</p>\n<p>1 월 14 일, 금요일</p>\n<p>저녁에는 법대 학교의 발전 계획 사본을 인쇄하여 분류에 따라 정리하고 너무 많이 수정하지는 않았습니다. 대학 진학의 원칙과 관련하여 Z Jun의 초안 작성 부분에는 다음과 같은 약간의 "영성"이 있습니다.</p>\n<p>"우리는 1 세기 초에 서서 상황을 압박하고있다"며 "우리는 당면 과제를 해결하는 것 외에도 탈출구가 없어 상황을 완전히 이해해야하며 한 세기의 어려움을 극복 할 기회가 없어야한다"고 강조했다. 도전은 기회이기도합니다 기회를 포착하고 도전 과제를 해결하는 것이 유일한 기회입니다.</p>\n<p>외부 환경의 급격한 변화에 직면하여 우리는 비교 우위로 자원을 충분히 활용할 수있는 한 로펌의 전반적인 발전을위한 가장 견고한 기반을 제공 할 수 있습니다. 우리가 가지고있는 자원은 오직 학문적입니다. 학문은 병원의 기초 일뿐만 아니라 강력한 병원으로가는 길입니다.</p>\n<p>우리는 구조 조정, 학술 연구 강화, 사회 요구를 출발점, 지렛대 및 학술 연구의 목적지로 간주하기 위해 우리나라의 사회주의 건설 발전에 주력해야합니다.</p>\n<p>국가에서 일류 또는 상급 수준을 달성하십시오. 규율의 장점을 최대한 발휘하면서 모든 제품을 선별하고 조정하여 고품질 제품을 만들어야합니다. 이를 바탕으로 Law School은 여러 주요 국내 학술 제품 라인을 구성하고 우수 클러스터를 수립합니다. 학문적 인 교차 침투 공명을 통해, 법률 학교의 학문적 연구의 포괄적 인 일선 효과가 만들어집니다.</p>\n<p>국제 표준을 지키고 따라 잡으십시오. 국제 학술 분야의 최신 발전 상황을 이해하고, 새로운 학문적 성장 포인트를 포착하고, 학술 연구에 중국 학자들의 비교 우위를 활용합니다.</p>\n<p>국내외 학술 연구에서 새로운 성장 포인트를 포착하고, 여러 분야의 그룹을 기반으로 학술적 교차 연구를 수행하여 전반적인 개발 이점을 창출하십시오.</p>\n<p>우선 순위에 우선 순위가 부여되었는지 확인하십시오. 학술 기관은 학업 개발의 ​​초점을 선택하고 자원 배분에 중점을두고 프로젝트 관리를 통해 우선 순위를 우선적으로 부여해야합니다.</p>\n<p>이론적 응용 연구를 수행하고 이론적 이점을 최대한 발휘하며 새로운 문제를 해결하고 사회 발전을위한 새로운 아이디어를 제안하십시오. 초점은 미래 지향적이며, 우리는 추세 연구를 강화해야합니다. 방법 론적 연구에 주목하십시오. 학술 연구를위한 새로운 방법과 도구의 사용을 권장합니다. 열린 연구로드를 준수하고 학교 내외의 상호 작용을 강화하십시오. ""</p>\n<p>정말이 정신을 홍보 할 수, 대학은 큰 미래를 것입니다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0176.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0176.md",frontmatter:{title:"11월 3일 목요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0176.md absPath of file >>> MarkdownRemark"}}}});
